import React from "react";
import { Row, Col, Container } from "reactstrap";
import moment from "moment";

export default class extends React.Component {
  render() {
    const { selectDetail } = this.props;
    const { hotel_data } = selectDetail;
    return (
      <Container
        style={{
          backgroundColor: "#f6f6f6",
          paddingTop: 25,
          paddingBottom: 25
        }}
      >
        <Col style={{ marginLeft: 5, marginRight: 5 }}>
          <div>
            <Row style={{ marginBottom: 5 }}>
              <Col size={2}>Name Hotel</Col>
              <Col size={8}>: {!hotel_data ? '-' : !hotel_data.summary.name.content ? '-' : hotel_data.summary.name.content}</Col>
            </Row>
            <Row style={{ marginBottom: 5 }}>
              <Col size={2}>City</Col>
              <Col size={8}>: {!hotel_data ? '-' : !hotel_data.summary.city.content ? '-' : hotel_data.summary.city.content}</Col>
            </Row>
            <Row style={{ marginBottom: 5 }}>
              <Col size={2}>Address</Col>
              <Col size={8}>: {!hotel_data ? '-' : !hotel_data.summary.address.content ? '-' : hotel_data.summary.address.content}</Col>
            </Row>
            <Row style={{ marginBottom: 5 }}>
              <Col size={2}>Check In</Col>
              <Col size={8}>: {!hotel_data ? '-' : !hotel_data.check_in ? '-' : hotel_data.check_in}</Col>
            </Row>
            <Row style={{ marginBottom: 5 }}>
              <Col size={2}>Check Out</Col>
              <Col size={8}>: {!hotel_data ? '-' : !hotel_data.check_out ? '-' : hotel_data.check_out}</Col>
            </Row>
          </div>
        </Col>
      </Container >
    );
  }
}
